import React from "react";
import styled from "styled-components";
import img01 from "../img/뚜뚜.jpg";
import img02 from "../img/로디.jpg";
import img03 from "../img/루피.jpg";
import img04 from "../img/뽀로로.jpg";
import img05 from "../img/뽀뽀,삐삐.jpg";
import img06 from "../img/에디.jpg";
import img07 from "../img/크롱.jpg";
import img08 from "../img/통통이.jpg";
import img09 from "../img/패티.jpg";
import img10 from "../img/포비.jpg";
import img11 from "../img/해리.jpg";

const Button = () => {
  function handleButtonClick() {
    console.log("냥");
  }

  return (
    <>
      <button type="submit" onClick={handleButtonClick}>
        변경
      </button>

      <PersonImg>
        <img src="img/bear.jpg" alt="bear" />
      </PersonImg>
      <PickBtn>
        <button>곰돌씨</button>
        <button>곰돌씨</button>
        <button>곰돌씨</button>
        <button>곰돌씨</button>
        <button>곰돌씨</button>
      </PickBtn>
    </>
  );
};

export default function button() {
  return (
    <>
      <PersonImg>
        <img src="img/bear.jpg" alt="bear" />
      </PersonImg>
      <PickBtn>
        <button>곰돌씨</button>
        <button>곰돌씨</button>
        <button>곰돌씨</button>
        <button>곰돌씨</button>
        <button>곰돌씨</button>
      </PickBtn>
    </>
  );
}

const PersonImg = styled.div`
  width: 100%;
  text-align: center;
`;

const PickBtn = styled.div`
  text-align: center;
  padding: 1%;
  margin-top: 10px;

  button {
    border: none;
    background-color: #ffdd6ec5;
    font-weight: 500;
    font-size: 13px;
    border-radius: 40px;
    margin-right: 5px;
    padding: 5px 17px 5px 17px;
  }
`;
